items.textDisplay:
@Hinto X Я живу в США. Интернет тут в городах есть везде. Где-то в среднем 50-100мегабит. Я конечно Старлинк купил, но в основном для тестирования. Иногда скорость 300, но в основном где-то 10-20.

Смысла создавать ещё один другой интернет для 90% населения, у которого уже есть интернет, нет. Маск ставит ставку именно на неосвоенную часть рынка. Пока этот рынок может 10% (на самом деле во многих странах гораздо выше), но когда население ради которых никто не стал бы тянуть волокно вдруг окажется подсоединённым, то баланс изменится. Больше народа смогут выбирать больше места где жить и работать на планете. 

Россия заморачиваться со Старлинком конечно не будет. Но это уже другая история.

