items.textDisplay:
@Алексей Карук одна из цитат:  "Павел Фельгенгауэр, Независимая газета 25.03.1992
ВСЕ АМЕРИКАНСКИЕ баллистические ракеты как наземного, так и морского базирования "заправлены" твердым ракетным топливом - горючим полимером большой энергоемкости (нечто отдаленно напоминающее порох). В то же время большая часть советских стратегических ракет заправлена жидким топливом - гептилом (несимметричный диметилгидразин). Данное горючее обладает огромными энергетическими возможностями. Гептил эффективнее керосина, который используется в космических ракетах. Он самовоспламеняется при соединении с окислителем (азотная кислота), обходится дешевле, чем твердое ракетное топливо, и может храниться под давлением азота в топливных баках готовой к пуску ракеты до 20 лет (гарантийный срок хранения - 10 лет)."
Я с вами согласен, и не могу в качестве аргумента ничего конкретного привести, скорее всего вы правы.

